import axios from "axios";
export default axios.create({
  baseURL: "https://tomcat1.shiftescape.com/api/",
  headers: {
    "Access-Control-Allow-Origin": "*",
    "Access-Control-Allow-Methods": "GET,PUT,POST,DELETE,PATCH,OPTIONS"
  }
});
